    <style>
      body {
        margin: 0px;
        padding: 0px;
        overflow: hidden;
        width: 100%;

      .container-fluid {
        width: 100%;
        height: 100%;
      }
      .loginComponent {
        height: 100vh;
      }
      .login {
        display: flex;
        justify-content: space-between;
        height: 100%;
      }
      .loginForm {
        width: 60%;
        background: #000;
      }
      .internalSection {
        margin: 80px 20px;
        padding: 50px 30px;
        /* display: flex;
            flex-direction: column;
            justify-content: space-around */
      }

      .welcomeMessgae {
        color: #ffffff;
        font-weight: bold;
        font-size: 2rem;
        line-height: 29px;
        margin: 20px 0px 50px 0px;
      }

      .loginButton button {
        background-color: #ed2a40;
        padding: 10px 10px;
        color: #ffffff;
        font-weight: bold;
        cursor: pointer;
        margin-top: 15px;
        font-size: 16px;
      }

      .loginButton a {
        text-decoration: none;
        color: #ffffff;
      }
      .loginButton a:hover {
        color: #ffffff;
      }

      .truckSection {
        width: 100%;
        height: 100%;
      }

      .truckSection img {
        width: 100%;
        height: 100%;
        object-fit: cover;
      }
      .logo{
        display: flex;
        justify-content: center;
      }
    </style>
